package StringClassJavaProgaramming;

public class TwoStringCompare {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String str1,str2;
		
		str1 = "A";
		str2 = "A";		
		System.out.println(str2.compareTo(str1));
		
		str1 = "A";
		str2 = "B";		
		System.out.println(str2.compareTo(str1));
		
		str1 = "B";
		str2 = "A";		
		System.out.println(str2.compareTo(str1));

	}

}
